import React from "react";
import loginImg from "../assets/login.png"

const Login = () => {

    return (
        <Template
            title="Welcome Back"
            desc1="Build skills for today, tommorrow and beyond."
            desc2="Education to future-proof your career"
            image={loginImg}
            formType="login"
            setIsLoggedIn={setIsLoggedIn}
        />
    )
}

export default Login;
